import { Link } from "react-router-dom";

const Opinioes = () => {
    return (
        <>

            <Link to='/' className="logo_inv"><img className="imgLogo" src={require(`../imagens/logo.png`)} height={707} width={707} alt='' /></Link>

            <img className="tit_opinioes" src={require(`../imagens/titulos/opinioes.png`)} height={600} width={600} alt='' />

            <div className="ret_opinioes">
                <img src={require('../imagens/retangulo_opinioes.png')} width={1440} alt='' />

                <div className="nome_opiniao">
                    <img src={require('../imagens/retangulo_nomes.png')} height={70} width={300} alt='' />
                    <p>Crónicas do Enterro</p>
                </div>

                <p> "Na sequência de mais um magnífico enterro de aveiro (talvez o meu último), e de uma grande depressão pós festa que provavelmente aconteceu a todos os estudantes, decidi fazer uma homenagem a este festival da melhor maneira possível.
                    Sendo que eu e os meus amigos costumamos vaguear pelo recinto e investigar a maior parte das barracas (para nos rirmos delas), pensei que fosse engraçado avaliá-las. Mas na verdade, como elas são todas  bastante obscenas, o único motivo pelo qual eu me sinto capaz de as classificar é por essa mesma obscenidade, ou como eu gosto de lhe chamar, “bartolice”/”javardice”.  (...)"
                </p>

                <Link to="">Ver Mais</Link>
            </div>


        </>
    );
}

export default Opinioes;
